import React, { useEffect } from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import { Provider } from 'react-redux';
import store from './redux/store';
import LandingPage from './components/LandingPage';
import HomePage from './components/HomePage'
import SearchBar from './components/SearchBar';
import './App.css';
import axios from 'axios';

function App() {
  useEffect(() => {
    async function fetchData() {
      try {
        const dogsResponse = await axios.get('http://localhost:3001/dogs');
        const dogs = dogsResponse.data;
        const temperamentsResponse = await axios.get('http://localhost:3001/temperaments');
        const temperaments = temperamentsResponse.data.map((t) => t.name);
        store.dispatch({ type: 'GET_DOGS', payload: dogs });
        store.dispatch({ type: 'GET_TEMPERAMENTS', payload: temperaments });
      } catch (error) {
        console.log(error);
      }
    }
    fetchData();
  }, []);

  return (
    <Provider store={store}>
      <div className="App">
        <Router>
          <Switch>
            <Route exact path="/" component={LandingPage} />
            <Route exact path="/home" component={HomePage} />
          </Switch>
        </Router>
      </div>
    </Provider>
  );
}

export default App;
